import React from 'react'

function OrdersContainer(props){

  function renderOrders(){
    return props.orders.map(order => {
      return 
        <tr>
          <th>
            {order.id}
          </th>
          <th>
            {order.item}
          </th>
        </tr>
    })
  }

  return (
    <table>
        <thead>
          <tr>
            <th>ID</th>
            <th>Item</th>
          </tr>
        </thead>
        <tbody>{renderOrders()}</tbody>
      </table>
  )
}

export default OrdersContainer;
